import time


def naive(a, b):
    if len(a) != len(b):
        return False
    for i in range(len(a)):
        if a[i] != b[i]:
            return False
    return True


def naive_match(text, pattern):
    matches = []
    t = len(text)
    p = len(pattern)
    for i in range(t - p + 1):
        # print(text[i:i+p])
        if naive(text[i:i+p], pattern):
            matches.append(i)
    return matches


genome = ""
gene = ""

result = naive_match("ABCEFG", "CDE")
start = time.time()
result = naive_match(genome, gene)
end = time.time()
print(f"{(end - start)*1000:.2f}ms")
